import '../styles/Registration.css';
import { Link } from "react-router-dom";
import { Navbar } from '../components/Navbar';
import { Footer } from '../components/Footer';
import bann1 from '../images/img1..jpeg';

export function SignUp() {
    return (
        <div className="signup">
            {/*
                    <h1>Sign up with email</h1>
                    <form className="form">
                        <input type="text" placeholder='Full Name' required />
                        <input type="email" placeholder='Email' required />
                        <input type="password" placeholder='Password' required />
                        <input type="password" placeholder='Confirmed Password' required />
                    </form>
                    <Link to = "/dashboard" className='signup_link'>Create Account</Link>
                    <p>By signing up, you agree to our <Link to="">Terms of Use</Link> and <Link to="">Privacy Policy.</Link></p>
                    <p>Already have an account? <Link to="/login">Login</Link></p>
                </div>
                <img src={bann1} alt="study" />
            </div>
            <Footer />*/}




            <Navbar />
            <div className="wrap2">
                <div className="wrap1">
                    <h1>Sign up with email</h1>
                        <form className="form">
                            <input type="text" placeholder='Full Name' required />
                            <input type="email" placeholder='Email' required />
                            <input type="password" placeholder='Password' required />
                        </form>
                    <Link to = "/dashboard" className='signup_link'>Continue with email</Link>
                    <div className="link">
                    <Link to="/signup" className='login_link'>Login with your organization</Link>
                    <p>Don't have an account? <Link to="/signup" className='login_link'>Sign up</Link></p>
                    </div>
                </div>
                <img src={bann1} alt="study" />
            </div>
            <Footer />
        </div>
    )
}
